import React from 'react';
import books from './books.jpg';
import logo from './logo.png';
import './showcase.css';

const Showcase = () => {
	return (
		<div className='showcase'>
			<div className='logo'>
				<img src={logo} alt='Logo' />
			</div>
		</div>
	)
}

export default Showcase;
